import React from 'react';
import logo from './logo.svg';
import { Button, Icon, Grid, Image } from 'semantic-ui-react'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          I am a Text label for Liam's App!
        </p>
        <Grid celled columns={2}>
          <Grid.Column>
            <Button color='blue'> I am a Text Button</Button>
          </Grid.Column>
          <Grid.Column>
          <Button icon color='blue'> <Icon name='plus' color = 'green' /> </Button>
          </Grid.Column>
        </Grid>
      </header>
    </div>
  );
}

export default App;
